(function($){

$(window).scroll(function(){
  var header = $('header'),
      scroll = $(window).scrollTop();

  if (scroll > 0) header.addClass('shadow');
  else header.removeClass('shadow');
});


$( document ).ready(function(){


	// $('.amazing_scroll .container .amazing_list ul li a').click(function(e){
	//   e.preventDefault();
	//   var target = $($(this).attr('href'));
	//   if(target.length){
	//     var scrollTo = target.offset().top - 350;
	//     $('body, html').animate({scrollTop: scrollTo+'px'}, 500);
	//   }
	// });

	/*=== slider#1 ===*/
		var $slick = $('.slider');
		var slideCount = null;

		$slick.slick({
			speed: 1000,
			arrows: true,
			slidesToShow: 1,
			prevArrow: $('.slider_btn_prev'),
      		nextArrow: $('.slider_btn_next'),
			dots: true,
			adaptiveHeight: true,			
		});


		
		$slick.on('init', function(event, slick){
		  slideCount = slick.slideCount;
		  setSlideCount();
		  setCurrentSlideNumber(slick.currentSlide);
		});

		$slick.on('beforeChange', function(event, slick, currentSlide, nextSlide){
		  setCurrentSlideNumber(nextSlide);
		});

		function setSlideCount() {
		  var $el = $('.slide-count-wrap').find('.total');
		  $el.text(slideCount);
		}

		function setCurrentSlideNumber(currentSlide) {
		  var $el = $('.slide-count-wrap').find('.current');
		  $el.text(currentSlide + 1);
		}
		
		/*=== //slider#1 ===*/

	$('select').styler();

	$('.stories_carousel').slick({
	  	slidesToShow: 2,
		slidesToScroll: 1,
		centerMode: true,
		centerPadding: '24%',
		  responsive: [
		    {
		      breakpoint: 992,
		      settings: {
		      	slidesToShow: 1,
		      }
		    },		    
		    {
		      breakpoint: 767,
		      settings: {
		      	slidesToShow: 1,
		      	centerPadding: '0',
		      }
		    },
		  ]
	});

	var mql = window.matchMedia('all and (max-width: 767px)');
    if (mql.matches) {
		$('.job_sidebar .job_sidebar_categories').slick({
		  	dots: false,
		  	infinite: false,
		  	speed: 300,
		  	slidesToShow: 1,
		  	variableWidth: true,
		  	arrows: true,
			prevArrow: $('.slider_btn_prev'),
	  		nextArrow: $('.slider_btn_next'),
		});
    }

	//end of screen stretch block 
	var e=jQuery(".stories_carousel_sec .container").width(), 
	t=(jQuery(".stories_carousel_sec").width()-e)/2+e;
    jQuery(".stories_carousel_holder").css( {width: t+"px"});		



	jQuery('.platform_mobile ul li.nav-item a').matchHeight({
		byRow: false
	});
	jQuery('.pricing_table_desk .table_cell').matchHeight();
	jQuery('.pricing_table_desk .table_top_btn').matchHeight();
	jQuery('.pricing_table_desk .table_top').matchHeight();
	jQuery('.pricing_table_desk .table_top_body').matchHeight();
	jQuery('.solubox_height').matchHeight();
	//jQuery('.our_solutions .solubox_height').matchHeight();
	//jQuery('.our_platform_blocks .solubox_height').matchHeight();
	jQuery('.stories_carousel .carousel_box_icon').matchHeight();
	jQuery('.stories_carousel .carousel_box_text').matchHeight();

    $( window ).resize(function() {
    	//end of screen stretch block 
		var e=jQuery(".stories_carousel_sec .container").width(), 
		t=(jQuery(".stories_carousel_sec").width()-e)/2+e;
	    jQuery(".stories_carousel_holder").css( {width: t+"px"});
    });

	$('.our_solutions .offsethere .col-lg-3').first().addClass('offset-lg-3');

	$('header .headmenu>li').each(function(){
		var menuitem = $(this).find('a').html();
		$(this).find('a').attr('data-label', menuitem);
		//console.log(menuitem);
	});

	$('.mobile_menu ul li.menu-item-has-children').append('<span class="caretbox"><i class="fa fa-angle-right" aria-hidden="true"></i></span>');

	$('.mobile_menu ul>li.menu-item-has-children .caretbox').click(function(){
		$('.back_mob').addClass('showback');
		$('.mobile_menu_holder>ul').addClass('opensub');
		$(this).parent().find('.sub-menu').addClass('subshow');
	});	

	$('.infoicon').click(function(){
		$('.table_note').hide();
		$(this).siblings('.table_note').show();
	});	
	$('.table_note .close').click(function(){
		$(this).closest('.table_note').hide();
	});

	$('.back_mob').click(function(){
		$('.mobile_menu_holder>ul').removeClass('opensub');
		$(this).parent().find('.sub-menu').removeClass('subshow');
		$('.back_mob').removeClass('showback');
	});

	$('.hamburger').click(function(){
		$('.mobile_menu').toggleClass('open');
		$('.mobile_menu_bgcloser').fadeToggle();
	});	
	$('.mobile_menu_bgcloser, .mobile_menu_closer').click(function(){
		$('.mobile_menu').removeClass('open');
		$('.mobile_menu_bgcloser').fadeToggle();
	});

	$('.top_note_close').click(function(){
		$('.top_note').slideUp();
	});

	$('.search_btn').click(function(){
		$('.hideonsearch').toggleClass('searchopen');
		$('.search_place').toggleClass('searchopen');
	});	

	$('.pricing_box').last().addClass('last');	

	$('.show_pricing').click(function(){
		$(this).toggleClass('open');
		//$(this).parent().siblings().find('.pricing_list').slideUp();
		$(this).siblings('.pricing_list').slideToggle();
	});	
	$('.ques_box_title').click(function(){
		$(this).toggleClass('open');
		$(this).parent().siblings().find('.ques_box_title').removeClass('open').siblings('.ques_box_text').slideUp();
		$(this).siblings('.ques_box_text').slideToggle();
	});	

	$('.question_box').first().find('.ques_box_title').addClass('open').siblings('.ques_box_text').show();


	$('.slides_menu li').first().addClass('active');
	$('.platform_slide').first().addClass('active');

	$('.slides_menu li a').click(function(e){
		e.preventDefault();

		$('.slides_menu li').removeClass('active');
		$(this).parent().addClass('active');


		var curLi = $(this).parent().attr('data-li');
		//console.log(curLi);
		$('.platform_slide').removeClass('active');
		$('.platform_slide[data-slide = '+curLi+']').addClass('active');
	});
});
})(jQuery);





